import React from 'react';

const posters = [
  '/posters/events/harrypotter.png',
  '/posters/events/hope.png',
  '/posters/events/taeyoon.png'
];

const Carousel = () => {
  return (
    <div className="relative mt-6 w-full overflow-hidden">
      <div className="flex transition-all duration-500 space-x-4 px-8">
        {posters.map((src, index) => (
          <img
            key={index}
            src={src}
            alt={`poster-${index}`}
            className="w-[300px] h-auto rounded-md shadow-md"
          />
        ))}
      </div>
      <div className="flex justify-center mt-3 space-x-2">
        {posters.map((_, i) => (
          <span key={i} className="w-2 h-2 bg-gray-400 rounded-full"></span>
        ))}
      </div>
    </div>
  );
};

export default Carousel;
